  false,\n\t\"url\": null,\n\t\"notes\": \"The National Oceanic and Atmospheric Administration
  (NOAA) has the statutory mandate to collect hydrographic data in support of nautical
  chart compilation for safe navigation and to provide background data for engineers,
  scientific, and other commercial and industrial activities. Hydrographic survey
  data primarily consist of water depths, but may also include features (e.g. rocks,
  wrecks), navigation aids, shoreline identification, and bottom type information.
  NOAA is responsible for archiving and distributing the source data as described
  in this metadata record.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
